<script>
  function escapeHtml(text)
  {
    if("string"!=(typeof text)){return text;}
    return text
        .replace(/&/g,"&amp;")
        .replace(/</g,"&lt;")
        .replace(/>/g,"&gt;")
        .replace(/"/g,"&quot;")
        .replace(/'/g,"&#039;");
  }

        tmp+='<td>'+v+'</td>';
      }
      out+='<tr>'+tmp+'</tr>';
    }
    out='<table>'+head+'<tbody align="right">'+out+'</tbody></table>';
    return out;
  }
  function draw(arr){document.getElementById("out").innerHTML=PrintMyTable(arr);}
</script>
